      out.write("\t\t\t\t    if(/(y+)/.test(fmt)){        \r\n");
      out.write("\t\t\t\t        fmt=fmt.replace(RegExp.$1, (this.getFullYear()+\"\").substr(4 - RegExp.$1.length));        \r\n");
