      out.write("\t\t\t\t            fmt = fmt.replace(RegExp.$1, (RegExp.$1.length==1) ? (o[k]) : ((\"00\"+ o[k]).substr((\"\"+ o[k]).length)));        \r\n");
      out.write("\t\t\t\t        }        \r\n");
      out.write("\t\t\t\t    }        \r\n");
      out.write("\t\t\t\t    return fmt;        \r\n");
      out.write("\t\t\t\t}      \r\n");
